%sIO: {
  Verbosity:    3
  EnableFilter: true
  RandomAccess: 2
  RandomSeed:   123
  InputFiles:   %s
  ProcessType:  ["Tensor3DCompressor","BatchFillerTensor3D","Tensor3DCompressor","BatchFillerTensor3D"]
  ProcessName:  ["%s_compressor_data","%s_data","%s_compressor_labels","%s_labels"]
  NumThreads: 5
  NumBatchStorage: 5

  ProcessList: {
    %s_compressor_data: {
      Verbosity: 3
      Tensor3DProducer: "data"
      OutputProducer: "data"
      CompressionFactor: 1
      PoolType: 1
    }
    %s_data: {
      Verbosity: 3
      Tensor3DProducer: "data"
    }
    %s_compressor_labels: {
      Verbosity: 3
      Tensor3DProducer: "label"
      OutputProducer: "label"
      compressionFactor: 1
      PoolType: 1
    }
    %s_labels: {
      Verbosity: 3
      Tensor3DProducer: "label"
    }
  }
}
